import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomeScreen from "../HomeScreen";
const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/">
        <HomeScreen />
      </Route>
    </Routes>
  );
};

export default AppRoutes;
